              <p className="absolute pr-2 right-0">$10/day</p>
              <p className="absolute pt-6 text-gray-800 font-light">San Diego, CA</p>
              <div className="pt-16relative overflow-hidden">
                <img className="w-full" src='https://images.unsplash.com/photo-1590820292118-e256c3ac2676?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=890&q=80'/>
              </div>
            </div>
        </div>
      </div>
  );
}

export default App;
